import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';
import BulletinPage from '../screens/bulletin';
import FavorDetails from '../screens/favorDetails';

const Stack = createStackNavigator();

export default function StackNav({route}) {
  return (
    <Stack.Navigator
      screenOptions={{
        headerStyle: { backgroundColor: '#FAFBFD' }
      }}
    >
      <Stack.Screen name="Bulletin" options={{ title: 'Neighbourhood Bulletin Board' }} component={BulletinPage} initialParams={route.params}/>
      <Stack.Screen name="Favour Details" component={FavorDetails} />
    </Stack.Navigator>
  );
}
